extern crate serde_json;

use std::fs::File;
use std::io::Write;
use std::path::Path;
use std::io::prelude::*;

pub fn get_prime() -> String {
    let mut out = String::new();
    let f_p = Path::new("/home/devin/temp/dkms/test-primes.json");
    {
        let mut f = File::open(f_p).expect("file not found");
        f.read_to_string(&mut out).expect("Failed to read prime file");
    }

    let mut primes: Vec<u32> = serde_json::from_str(&out).expect("JSON parsing of primes failed");
    let rtn = primes.pop();

    match rtn {
        Some(r) => {
            let mut f = File::create(f_p).expect("file not found");
            f.write_all(serde_json::to_string(&primes).unwrap().as_bytes()).expect("Failed to write prime file");
            format!("{}", r)
        }
        None => {
            panic!("We are out of SHORT PRIMES");
        }
    }
}


